var title_f19_32_19979="Broad versus narrow-spectrum AEDs";
var content_f19_32_19979=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F78021&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F78021&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Antiepileptic medications and seizure types",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Seizure type",
"       </td>",
"       <td class=\"subtitle1\">",
"        Antiepileptic drug",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Broad spectrum:",
"        </strong>",
"        <em>",
"         all",
"        </em>",
"        seizure types (generalized from onset",
"        <em>",
"         and",
"        </em>",
"        partial onset seizures)",
"       </td>",
"       <td>",
"        Clobazam, felbamate, lamotrigine, levetiracetam, rufinamide, topiramate, valproate, zonisamide",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Narrow spectrum:",
"        </strong>",
"        (",
"        <em>",
"         simple partial, complex partial, and secondarily generalized seizures",
"        </em>",
"        )",
"       </td>",
"       <td>",
"        Carbamazepine, ezogabine,&nbsp;gabapentin, lacosamide, oxcarbazepine, perampanel,&nbsp;phenobarbital, phenytoin, pregabalin, primidone, tiagabine, vigabatrin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <em>",
"         Absence seizure",
"        </em>",
"        (a type of generalized seizure)",
"       </td>",
"       <td>",
"        Ethosuximide",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Note that although there is evidence to support the use of these medications for these seizure types, the medication may not be indicated for this use by the United States Food and Drug Administration.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
