var title_f19_32_19981="Cetuximab monotherapy colorectal cancer";
var content_f19_32_19981=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F76312&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F76312&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Cetuximab monotherapy for metastatic, K-ras wild type colorectal cancer",
"    <sup>",
"     [1]",
"    </sup>",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td colspan=\"4\">",
"        Cycle length: Weekly.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose and route",
"       </td>",
"       <td class=\"subtitle1\">",
"        Administration",
"       </td>",
"       <td class=\"subtitle1\">",
"        Given on days",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Cetuximab",
"        </strong>",
"       </td>",
"       <td>",
"        400 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        The appropriate dose should be withdrawn from the vials (supplied in a concentration of 2 mg/mL) and aseptically transferred into an empty sterile IV bag without further dilution. The initial dose should be infused over 120 minutes*",
"        <sup>",
"         &Delta;",
"        </sup>",
"        .",
"       </td>",
"       <td>",
"        Day 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Cetuximab",
"        </strong>",
"       </td>",
"       <td>",
"        250 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        IV",
"       </td>",
"       <td>",
"        If Day 1 is tolerated, subsequent doses may be administered over 60 minutes.",
"       </td>",
"       <td>",
"        Weekly, beginning Day 8",
"        <sup>",
"         &loz;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Pretreatment considerations:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Emesis risk:",
"        </strong>",
"        LOW (&lt;30 percent frequency of emesis). Refer to UpToDate topic on \"Prevention and treatment of chemotherapy-induced nausea and vomiting\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Prophylaxis for infusion reactions:",
"        </strong>",
"        Premedication with diphenhydramine with or without a glucocorticoid at least prior to the first infusion",
"        <sup>",
"         [2]",
"        </sup>",
"        . Refer to UpToDate topic on \"Infusion reactions to therapeutic monoclonal antibodies used for cancer therapy\".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Monitoring parameters:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Assess basic metabolic panel (including creatinine, magnesium, calcium, and potassium) prior to each dose. Monitor serum calcium, magnesium, and potassium levels weekly for eight weeks after completion of therapy",
"        <sup>",
"         [2]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull; Monitor for skin rash.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"4\">",
"        Suggested dose alterations for toxicity:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\" colspan=\"4\">",
"        &bull;",
"        <strong>",
"         Dermatologic toxicity:",
"        </strong>",
"        Severe dermatologic reactions, such as acneiform rash, require delayed administration of cetuximab and/or dose reduction. Refer to UpToDate topic on \"",
"        <span class=\"emphasis\">",
"         Acneiform eruption secondary to epidermal growth factor (EGFR) inhibitors",
"        </span>",
"        \".",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         If there is a change in body weight of at least 10 percent, dose should be recalculated.",
"        </strong>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     This table is provided as an example of how to administer this regimen; there may be other acceptable methods. This regimen must be administered by a clinician trained in the use of chemotherapy. The clinician is expected to use his or her independent medical judgment in the context of individual circumstances to make adjustments, as necessary.",
"    </strong>",
"    <div class=\"footnotes\">",
"     IV: intravenous.",
"     <br>",
"      * Cetuximab should be administered with an infusion or syringe pump, using a low protein-binding 0.22 micron in line filter. Do not shake or dilute. Flush line with normal saline.",
"      <br>",
"       &Delta; A slower infusion rate should be considered in areas with a high incidence of infusion reactions (such as the Southeast United States). Refer to UpToDate topic on \"Infusion reactions to the therapeutic monoclonal antibodies used in cancer therapy\".",
"       <br>",
"        <font class=\"lozenge\">",
"         &loz;",
"        </font>",
"        Results from a nonrandomized phase II trial",
"        <sup>",
"         [3]",
"        </sup>",
"        and a multicenter retrospective analysis",
"        <sup>",
"         [4]",
"        </sup>",
"        suggest that cetuximab at a dose of 500 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        every two weeks results in similar plasma concentrations and single-agent activity as does weekly dosing.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     References:",
"     <br>",
"      <ol>",
"       <li>",
"        Jonker DJ, et al. N Engl J Med 2007; 357:2040.",
"       </li>",
"       <li>",
"        Erbitux (cetuximab) injection. US FDA-approved manufacturer's package insert. US National Library of Medicine. (Available online at dailymed.nlm.nih.gov, accessed on February 14, 2012).",
"       </li>",
"       <li>",
"        Pfeiffer P, et al. Ann Oncol 2008; 19:1141.",
"       </li>",
"       <li>",
"        Bouchahda M, et al. Med Oncol 2011; 28 Suppl 1:253.",
"       </li>",
"      </ol>",
"     </br>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
